import styled from 'styled-components';

export const Container = styled.div`
margin: auto;
width: 800px;
background: #f1f1f1;
padding: 10px;
border-radius: 8px;
box-shadow: 10px 10px 4px #eaeaea;
text-align: center;
position: relative;
top: 10px;
`;

export const BookingDetail = styled.div`
	display flex;
	justify-content: space-between;
	align-items: center;
`;
